#include <iostream>
#include <string>
#include <algorithm>
#include <vector>

using namespace std;

class Solution {
public:
    string shortestPalindrome(const string &s) {
        string rev = s;
        reverse(rev.begin(), rev.end());
        string pattern = s + '#' + rev;

        vector lps(pattern.size(), 0);
        int len = 0;

        for (int i = 1; i < pattern.size(); ++i) {
            if (pattern[len] == pattern[i]) {
                ++len;
                lps[i] = len;
            } else {
                if (len > 0) {
                    len = lps[len - 1];
                }
            }
        }


        string suffix = s.substr(lps[pattern.size() - 1]);
        reverse(suffix.begin(), suffix.end());

        return suffix + s;
    }
};

int main() {
    Solution s;

    cout << s.shortestPalindrome("aacecaaa") << endl; //aaacecaaa
    cout << s.shortestPalindrome("abcd") << endl; //dcbabcd
    // cout << s.shortestPalindrome("") << endl; //""
    // cout << s.shortestPalindrome("abb") << endl; //bbabb
    // cout << s.shortestPalindrome(
                // "")
            // << endl; //bbabb

    return 0;
}
